import React from 'react'
import "./Card.css"

const Card = ({emoji, heading, detail}) => {
  return (
    <div className="card">
        <img src={emoji} alt="emoji" />
        <span>{heading}</span>
        <span>{detail}</span>
        <button className="learn">Learn more</button>
    </div>
  )
}

export default Card
